import React from "react";
import ProductTile from "./ProductTile";

function MyButton() {
  return (
    <button>
      I'm a button
    </button>
  );
}

export default function MyApp() {
  return (
    <div>
      <h1>Welcome to my app</h1>
      <MyButton />
      <ProductTile
      image="https://www.mlkingfood.com/wp-content/uploads/2020/09/Saffron-5gm-1536x1536.jpg"
      description="Experience the luxury of pure, hand-picked saffron threads, perfectly preserved in a bottle for vibrant colour and exquisite flavour."
      price="800"
      />
    </div>
  );
}
